import { Suspense, lazy } from 'react';
import { Navigate } from 'react-router-dom';
import { RouteObject } from 'react-router';

import SidebarLayout from './layouts/SidebarLayout';
import BaseLayout from './layouts/BaseLayout';

import SuspenseLoader from './components/SuspenseLoader';

const Loader = (Component:any) => (props:any) => (
  <Suspense fallback={<SuspenseLoader />}>
    <Component {...props} />
  </Suspense>
);

// Pages

const Overview = Loader(lazy(() => import('./content/overview')));
const Login = Loader(lazy(() => import('./content/pages/Components/Login')));

// Dashboards

const Main = Loader(lazy(() => import('./content/dashboards/Main')));

// Applications


const UserProfile = Loader(lazy(() => import('./content/applications/Users/profile')));
// Components

const User = Loader(lazy(() => import('./content/pages/Components/Users')));
const DataTable = Loader(lazy(() => import('./components/DataTables')));
const Designation = Loader(lazy(() => import('./content/pages/Components/Designation')));
const Role = Loader(lazy(() => import('./content/pages/Components/Role')));

// Status

const Status404 = Loader(lazy(() => import('./content/pages/Status/Status404')));
const Status500 = Loader(lazy(() => import('./content/pages/Status/Status500')));
const StatusComingSoon = Loader(lazy(() => import('./content/pages/Status/ComingSoon')));
const StatusMaintenance = Loader(lazy(() => import('./content/pages/Status/Maintenance')));

//const routes: RouteObject[] = [
const routes = (isLoggedIn) => [
  {
    path: 'login',
    element: <BaseLayout />,
    children: [
      {
            path: '',
            element: <Login />
      },
      {
        path: 'login',
        element: (
          <Navigate
                to="/login"
            replace
          />
        )
        },
        
      {
        path: 'status',
        children: [
          {
            path: '',
            element: (
              <Navigate
                to="404"
                replace
              />
            )
          },
          {
            path: '404',
            element: <Status404 />
          },
          {
            path: '500',
            element: <Status500 />
          },
          {
            path: 'maintenance',
            element: <StatusMaintenance />
          },
          {
            path: 'coming-soon',
            element: <StatusComingSoon />
          },
        ]
      },
      {
        path: '*',
        element: <Status404 />
      },
    ]
  },
  {
    path: '*',
      element: (isLoggedIn ?
          <SidebarLayout /> : <Navigate
              to="/login"
              replace
          />
      ),
    children: [
      {
        path: '',
            element: <Main />
      },
    ]
  },
  {
      path: 'management',
      element: (isLoggedIn ? 
          <SidebarLayout /> : <Navigate
              to="/login"
              replace
          />
    ),
    children: [
      {
        path: '',
        element: (
          <Navigate
            to="/management/client"
            replace
          />
        )
      },
      {
          path: 'client',
          element: <Client />
        },
        {
            path: 'company',
            element: <Company />
        },
        //{
        //    path: 'shareholder',
        //    element: <ShareHolder />
        //},
        {
            path: 'director',
            element: <Director />
        },
        {
            path: 'agent',
            element: <Agent />
        },
        {
            path: 'manager',
            element: <Manager />
        },
    ]
    },
  
  {
    path: 'masters',
      element: (isLoggedIn ?
          <SidebarLayout /> : <Navigate
              to="/login"
              replace
          />
      ),
    children: [
      {
        path: '',
        element: (
          <Navigate
            to="/masters/buttons"
            replace
          />
        )
      },
        {
            path: 'companytype',
            element: <CompanyType />
        },
      {
          path: 'designation',
          element: <Designation />
      },
      {
          path: 'directortype',
          element: <DirectorType />
      },
      {
          path: 'nationality',
          element: <Nationality />
      },
      {
          path: 'placeofbirth',
          element: <PlaceOfBirth />
      },
      {
          path: 'managerType',
          element: <ManagerType />
      },
      {
          path: 'shareholdertype',
          element: <ShareholderType />
        },
        {
          path: 'sharetype',
          element: <ShareType />
      },
      {
          path: 'idtype',
          element: <IDType />
      },
    ]
  },
    {
        path: 'security',
        element: (isLoggedIn ?
            <SidebarLayout /> : <Navigate
                to="/login"
                replace
            />
        ),
        children: [
            {
                path: '',
                element: (
                    <Navigate
                        to="/security/user"
                        replace
                    />
                )
            },
            {
                path: 'user',
                element: <User />
            },
            {
                path: 'role',
                element: <Role />
            },
            {
                path: 'location',
                element: <Location />
            },
            {
                path: 'roleaccess',
                element: <RoleAccess />
            },
        ]
    },
];

